import css from './TikTokLikesPage.module.css';

export default function TikTokLikes({ data, index }) {
  const { quantity, percent, price, oldPrice, savings, active, toggleLikes } =
    data;

  return (
    <div
      className={`${css.faq} ${data.open ? css.open : ''}`}
      key={index}
      onClick={() => toggleLikes(index)}
    >
      <div className="buyLikesQuantity">
        <div className="quantity">{quantity}</div>
        <div className="discount">{percent}</div>
      </div>

      <div className="priceBlock">
        <div className="mainPrice">{price}</div>
        <div className="oldPrice">{oldPrice}</div>
        <div className="savings">{savings}</div>
      </div>
    </div>
  );
}
